import{addListener}from"../../event-listeners/listeners.js";import updateCalendar from"./updateCalendar.js";export default async function addNavigationListeners(e,t,r){try{let a=(new Date).getMonth(),n=(new Date).getFullYear();const o=e.querySelector("#prev-button"),s=e.querySelector("#next-button");addListener(o,"click",(async()=>{a--,a<0&&(a=11,n--),await updateCalendar({currentMonth:a,currentYear:n,storedDates:t,calendar:e,onUpdate:r})})),addListener(s,"click",(async()=>{a++,a>11&&(a=0,n++),await updateCalendar({currentMonth:a,currentYear:n,storedDates:t,calendar:e,onUpdate:r})}))}catch(e){const{default:t}=await import("../../error-messages/errorLogs.js");throw await t("addNavigationListenersError","Add Navigation Listeners Error: ",e),e}}